import { Typography } from '@mui/material'
import React from 'react'
import { Grid } from 'swiper'

function Location() {
  return (
    <div>
        <Typography sx={{fontSize:'2rem',color:'#342e39',marginBottom:"1rem",marginTop:'1rem'}}>World Wide Location</Typography>
        <Grid>
          <p style={{fontWeight:"700",fontSize:'1rem',marginBottom:'0',
        }}>Mandapeta</p>
        </Grid>
    </div>
  )
}

export default Location
